import React, { useContext, useEffect, useState } from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import AcademicIssuePage from "./AITS_Pages/issuepage";
import StudentDashboard from "./AITS_Pages/StudentDashboard";
import WelcomePage from "./AITS_Pages/WelcomePage";
import LoginPage from "./AITS_Pages/LoginPage";
import LecturerDashboard from "./AITS_Pages/LecturerDashboard";
import Registrardashboard from "./AITS_Pages/Registrardashboard";
import { ToastContainer } from "react-toastify";
import { authContext } from "./context/AuthContext";
import "react-toastify/dist/ReactToastify.css";

function App() {
  const [loading, setLoading] = useState(true);
  const { userLoginData } = useContext(authContext);
  const isAuthenticated = !!localStorage.getItem("token");

  useEffect(() => {
    document.title = "AITS";
    // Simulate loading user data (replace with actual auth check)
    const timer = setTimeout(() => setLoading(false), 500);
    return () => clearTimeout(timer);
  }, []);

  if (loading) {
    return (
      <div className="flex justify-center items-center h-screen">
        <div className="animate-spin rounded-full h-12 w-12 border-t-2 border-b-2 border-blue-500"></div>
      </div>
    );
  }

  return (
    <>
      <Router>
        <Routes>
          {/* Public Routes */}
          {!isAuthenticated ? (
            <>
              <Route path="/" element={<WelcomePage />} />
              <Route path="/login" element={<LoginPage />} />
              <Route path="*" element={<Navigate to="/" replace />} />
            </>
          ) : (
            <>
              {/* Student Routes */}
              {userLoginData?.role === "student" && (
                <>
                  <Route path="/student" element={<StudentDashboard />} />
                  <Route path="/student/academic-issues" element={<AcademicIssuePage />} />
                  <Route path="*" element={<Navigate to="/student" replace />} />
                </>
              )}

              {/* Lecturer Routes */}
              {userLoginData?.role === "lecturer" && (
                <>
                  <Route path="/lecturer" element={<LecturerDashboard />} />
                  <Route path="/lecturer/academic-issues" element={<AcademicIssuePage />} />
                  <Route path="*" element={<Navigate to="/lecturer" replace />} />
                </>
              )}

              {/* Registrar Routes */}
              {userLoginData?.role === "registrar" && (
                <>
                  <Route path="/registrar-dashboard" element={<Registrardashboard />} />
                  <Route path="*" element={<Navigate to="/registrar-dashboard" replace />} />
                </>
              )}

              {/* Fallback for authenticated users without recognized role */}
              {!["student", "lecturer", "registrar"].includes(userLoginData?.role) && (
                <Route path="*" element={<Navigate to="/login" replace />} />
              )}
            </>
          )}
        </Routes>
      </Router>

      {/* Toast Notifications */}
      <ToastContainer
        position="top-right"
        autoClose={3000}
        hideProgressBar={false}
        newestOnTop={false}
        closeOnClick
        rtl={false}
        pauseOnFocusLoss
        draggable
        pauseOnHover
      />
    </>
  );
}

export default App;
